function.textSource:
      function CF_ecart_htFormula return Number is
begin
  IF (:type='1') THEN
  	  IF (:montant_mens is not null) then
  			RETURN(:fact_total-NVL(:montant_mens,0));
  		ELSE
  			RETURN(:fact_total-NVL(:conso_tot,0));
  	END IF;
  ELSE
  	RETURN(NULL);
  END IF;
end;

      function CF_ecart_htrFormula return Number is
taux_r number(9,2);
result number(12,2);
begin
	SELECT taux into taux_r FROM taux_recup,datdebex
	WHERE annee=decode(:p_param7,'N',to_char(datdebex,'YYYY'),to_char(to_number(to_char(datdebex,'YYYY'))-1))
	AND filcode='01 ';
	
   IF (:type='1') THEN
   	result := :cf_ecart_ht+(:cf_tva-taux_r/100*:cf_tva)/100*:cf_ecart_ht;
  	RETURN(result);
  ELSE
  	RETURN(NULL);
  END IF;
end;

      function CF_1Formula return Number is
  l_tva number(9,2);
begin
	SELECT tva INTO l_tva FROM tva WHERE datetva=(SELECT MAX(datetva) FROM tva);
  RETURN(l_tva);
end;

      function CF_fact_htFormula return Number is
begin
  	IF (:type='1' and :fact_total is null) THEN
  	RETURN(-1*NVL(:conso_tot,0));
	ELSE
		RETURN(NULL);
	END IF;
end;

      function CF_fact_htrFormula return Number is
taux_r number(9,2);
result number(12,2);
begin
		SELECT taux into taux_r FROM taux_recup,datdebex
	WHERE annee=decode(:p_param7,'N',to_char(datdebex,'YYYY'),to_char(to_number(to_char(datdebex,'YYYY'))-1))
	AND filcode='01 ';
	
    IF (:type='1' and :fact_total is null) THEN
    	result := :cf_fact_ht+(:cf_tva-taux_r/100*:cf_tva)/100*:cf_fact_ht;
  	RETURN(result);
  ELSE
  	RETURN(NULL);
  END IF;
end;

      function AfterPForm return boolean is
begin
  :P_PERIME:=PACK_GLOBAL.LIRE_PERIME(:P_GLOBAL);
  --srw.message(1,:P_PERIME);	
  return (TRUE);
end;

      function CF_1FORMULA0007 return Number is
ecart number(9,2);
begin
ecart:=:conso - :conso_expense;
  
  	RETURN ecart;

end;
